import { Card, Form, Button, Container, Row, Col, Badge, Alert, Tab, Tabs, ListGroup, Accordion, Modal } from 'react-bootstrap'
import React, { list,useRef,useState, useEffect ,Sonnet } from 'react';
const sc=require("../services/serverCom.js");

//ref to Todo.js -> ListsComponent
let global_setProjcetList
const ProjectWindow = ({ projectJson}) => {

    const ProjectInfoTab = () => {


        return (    
            <div className="home" >
                {projectJson.map(({ _id,projectName, creator, projectDesc, time}) => (
                   <div className="labelStyle" >Project ID: {_id}</div>
                ))}    
            </div>
            
    
        )}


    return (    
        <div className='center'>
        <div className="home" >
            <div className="labelStyle" >Project: {projectJson.projectName}</div>
        </div>
            <Tabs defaultActiveKey="profile" id="uncontrolled-tab-example" className="mb-3">
            <Tab eventKey="home" title="Home">
                <ProjectInfoTab />   

            </Tab>
            <Tab eventKey="profile" title="Profile">

            </Tab>
            <Tab eventKey="contact" title="Contact" disabled>

            </Tab>
            </Tabs>
        </div>
        

    )}



export default ProjectWindow
